  constructor(props){
    super(props);
    this.state = {
      customers: [],
      clicked_keyword: ""
    }
    this.handler = this.handler.bind(this)
  }
  handler(keyword){
    this.setState({
      clicked_keyword: keyword
    })
    console.log("77", this)

  }


  //console.log("hello")
  async componentDidMount() {
     fetch('http://localhost:4000/products')
      .then(response => response.json())
      .then(data => {this.setState({customers:data.data})})
